db.patients.aggregate([
    {$unwind: "$ENCOUNTERS"},
    {$unwind: "$ENCOUNTERS.ALLERGIES"}, 
    {$match: {"ENCOUNTERS.ALLERGIES.DESCRIPTION": "Animal dander (substance)"} }, 
    { $project: {
        _id: 0, 
        ENCOUNTER_ID: "$ENCOUNTERS.ENCOUNTER_ID",
        ENCOUNTER_START_DATE: { $dateToString: { format: "%Y-%m-%d", date: "$ENCOUNTERS.START" } },
