        } 
    }] ).sort({ ENCOUNTER_ID: 1 })

db.payers.aggregate([
    {
        $match: {
            PAYER_ID: "d31fccc3-1767-390d-966a-22a5156f4219"
        }
    },
    {
        $lookup: {
            from: "patients",
            localField: "PAYER_ID",
            foreignField: "CLAIMS.PRIMARY_PATIENT_INSURANCE_REF",
            as: "patients"
        }
    },
    {
        $unwind: "$patients"
    },
    {
        $unwind: "$patients.ENCOUNTERS"
    },
    {
        $unwind: "$patients.ENCOUNTERS.IMMUNIZATIONS"
    },
    {
        $match: {
            $expr: {
                $eq: [
                    "$patients.ENCOUNTERS.IMMUNIZATIONS.PAYER_COVERAGE",
                    0
                ]
            }
        }
    },
    {
        $group: {
            _id: null,
            num_immunizations: {
                $sum: 1
            }
        }
    },
    { 
        $project: {
            _id: 0,
            num_uncovered_immunizations: "$num_immunizations"
        }
    }
])

