db.payers.aggregate([
    {
        $match: {
            "NAME": "NO_INSURANCE"
        }
    },
    {
        $lookup: {
            from: "patients",
            localField: "_id",
            foreignField: "CLAIMS.PRIMARY_PATIENT_INSURANCE_REF",
            as: "patient_data"
        }
    },
    {
        $unwind: "$patient_data"
    },
    {
        $unwind: "$patient_data.CLAIMS"
    },
    {
        $unwind: "$patient_data.CLAIMS.CLAIM_TRANSACTIONS"
    },
    {
        $match: {
            "patient_data.CLAIMS.CLAIM_TRANSACTIONS.TYPE": "COVERED"
        }
    },
    {
        $group: {
            _id: null,
            total_covered: {
                $sum: 1
            }
        }
    },
    {
        $project: {
            _id: 0,
            total_covered: 1
        }
    },
    {
        $lookup: {
            from: "patients",
            localField: "_id",
            foreignField: "CLAIMS.PRIMARY_PATIENT_INSURANCE_REF",
            as: "patient_data"
        }
    },
    {
        $unwind: "$patient_data"
    },
    {
        $unwind: "$patient_data.CLAIMS"
    },
    {
        $unwind: "$patient_data.CLAIMS.CLAIM_TRANSACTIONS"
    },
    {
        $match: {
            "patient_data.CLAIMS.CLAIM_TRANSACTIONS.TYPE": "UNCOVERED"
        }
    },
    {
        $group: {
            _id: null,
            total_uncovered: {
                $sum: 1
            }
        }
    },
    {
        $project: {
            _id: 0,
            total_uncovered: 1
        }
    },
    {
        $project: {
            total_uncovered_by_NO_INSURANCE: {
                $subtract: ["$total_covered", "$total_uncovered"]
            }
        }
    }
])

db.payers.aggregate([
