db.patients.aggregate([
  {
    $match: {
      "ENCOUNTERS.ALLERGIES.DESCRIPTION": "Shellfish (substance)"
    }
  },
  {
    $unwind: "$ENCOUNTERS"
  },
  {
    $unwind: "$ENCOUNTERS.ALLERGIES"
  },
  {
    $match: {
      "ENCOUNTERS.ALLERGIES.DESCRIPTION": "Shellfish (substance)"
    }
  },
  {
    $unwind: {
      path: "$ENCOUNTERS.ALLERGIES.REACTION_1",
      preserveNullAndEmptyArrays: true
    }
  },
  {
    $group: {
      _id: {
        r: "$ENCOUNTERS.ALLERGIES.REACTION_1",
        description: "$ENCOUNTERS.ALLERGIES.DESCRIPTION_1"
      },
      count: {
        $sum: 1
      }
    }
  },
  {
    $project: {
      _id: 0,
      reaction: "$_id.r",
      description: "$_id.description",
      count: 1
    }
  }
])

