db.patients.aggregate([
  {
    $unwind: "$MEDICATIONS"
  },
  {
    $match: {
      "MEDICATIONS.DESCRIPTION": "72 HR Fentanyl 0.025 MG/HR Transdermal System"
    }
  },
  {
    $group: {
      _id: null,
      SUCCESS_RATE: { $sum: { $cond: { if: { $eq: ["$MEDICATIONS.REASON_CODE", "0"], then: 1, else: 0 } } } }
    }
  },
  {
    $project: {
      _id: 0,
      SUCCESS_RATE: { $multiply: [ "$SUCCESS_RATE", 100 ] },
      SUCCESS_RATE_STR: { $concat : [ { $toString: "$SUCCESS_RATE" }, "%"] }
    }
  }
])

db.patients.aggregate([
    {
      $unwind: "$ENCOUNTERS"
    },
    {
      $unwind: "$ENCOUNTERS.MEDICATIONS"
    },
    {
      $match: {
        "ENCOUNTERS.MEDICATIONS.DESCRIPTION": "Hydrochlorothiazide 25 MG Oral Tablet"
      }
    },
    {
      $group: {
        _id: "$ENCOUNTERS.MEDICATIONS.DESCRIPTION",
        min_stop: { $min: "$ENCOUNTERS.MEDICATIONS.STOP" },
        max_stop: { $max: "$ENCOUNTERS.MEDICATIONS.STOP" },
      }
    },
    {
      $addFields: {
        duration: { $subtract: ["$max_stop", "$min_stop"] }
      }
    },
    {
      $project: {
        _id: 0,
        medication: "$_id",
        min_stop: "$min_stop",
        max_stop: "$max_stop",
        duration: "$duration"
      }
    }
])
